import React from 'react';
import './App.css';
import searchBar from './components/searchBar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <div className='container'>
          <searchBar/>
        </div>

      </header>
    </div>
  );
}

export default App;
